import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import parse from 'html-react-parser';

class TeamV2 extends Component {

    render() {

        let publicUrl = process.env.PUBLIC_URL+'/'
        let imagealt = 'image'

    return <section className="team-one team-one__about-page">
		  <div className="container">
		    <div className="block-title-two text-center">
		      <p><span>Our Team</span></p>
		      <h3>Meet Our Exclusive <br /> Team Member</h3>
		    </div>{/* /.block-title */}
		    <div className="row">
		      <div className="col-lg-3 col-md-6">
		        <div className="team-one__single">
		          <div className="team-one__image">
		            <img src={publicUrl+"assets/images/team/team-1-1.jpg"} alt={ imagealt } />
		          </div>{/* /.team-one__image */}
		          <div className="team-one__content">
		            <div className="team-one__social">
		              <a href="#"><i className="fab fa-facebook-f" /></a>
		              <a href="#"><i className="fab fa-twitter" /></a>
		              <a href="#"><i className="fab fa-google-plus-g" /></a>
		              <a href="#"><i className="fab fa-behance" /></a>
		            </div>{/* /.team-one__social */}
		            <h3>Ricardo Torres</h3>
		            <p>Web designer</p>
		          </div>{/* /.team-one__content */}
		        </div>{/* /.team-one__single */}
		      </div>{/* /.col-lg-3 */}
		      <div className="col-lg-3 col-md-6">
		        <div className="team-one__single">
		          <div className="team-one__image">
		            <img src={publicUrl+"assets/images/team/team-1-2.jpg"} alt={ imagealt } />
		          </div>{/* /.team-one__image */}
		          <div className="team-one__content">
		            <div className="team-one__social">
		              <a href="#"><i className="fab fa-facebook-f" /></a>
		              <a href="#"><i className="fab fa-twitter" /></a>
		              <a href="#"><i className="fab fa-google-plus-g" /></a>
		              <a href="#"><i className="fab fa-behance" /></a>
		            </div>{/* /.team-one__social */}
		            <h3>Paul Sanchez</h3>
		            <p>Web designer</p>
		          </div>{/* /.team-one__content */}
		        </div>{/* /.team-one__single */}
		      </div>{/* /.col-lg-3 */}
		      <div className="col-lg-3 col-md-6">
		        <div className="team-one__single">
		          <div className="team-one__image">
		            <img src={publicUrl+"assets/images/team/team-1-3.jpg"} alt={ imagealt } />
		          </div>{/* /.team-one__image */}
		          <div className="team-one__content">
		            <div className="team-one__social">
		              <a href="#"><i className="fab fa-facebook-f" /></a>
		              <a href="#"><i className="fab fa-twitter" /></a>
		              <a href="#"><i className="fab fa-google-plus-g" /></a>
		              <a href="#"><i className="fab fa-behance" /></a>
		            </div>{/* /.team-one__social */}
		            <h3>Herbert Waters</h3>
		            <p>Web designer</p>
		          </div>{/* /.team-one__content */}
		        </div>{/* /.team-one__single */}
		      </div>{/* /.col-lg-3 */}
		      <div className="col-lg-3 col-md-6">
		        <div className="team-one__single">
		          <div className="team-one__image">
		            <img src={publicUrl+"assets/images/team/team-1-4.jpg"} alt={ imagealt } />
		          </div>{/* /.team-one__image */}
		          <div className="team-one__content">
		            <div className="team-one__social">
		              <a href="#"><i className="fab fa-facebook-f" /></a>
		              <a href="#"><i className="fab fa-twitter" /></a>
		              <a href="#"><i className="fab fa-google-plus-g" /></a>
		              <a href="#"><i className="fab fa-behance" /></a>
		            </div>{/* /.team-one__social */}
		            <h3>Jeremy Harrington</h3>
		            <p>Web designer</p>
		          </div>{/* /.team-one__content */}
		        </div>{/* /.team-one__single */}
		      </div>{/* /.col-lg-3 */}
		    </div>{/* /.row */}
		  </div>{/* /.container */}
		</section>

        }
}

export default TeamV2
